import React from 'react';

function NextMatch({ currentMatch, onNextMatch }) {
  return (
    <div className="next-match">
      <h2>Current Match</h2>
      {currentMatch ? (
        <>
          <p>{currentMatch}</p>
          <button onClick={onNextMatch} className="next-button">
            Next Match
          </button>
        </>
      ) : (
        <p>No match is currently happening.</p>
      )}
    </div>
  );
}

export default NextMatch;
